INSERT INTO `bp_im_question_content` (`qid`, `content`) VALUES
(8, '&lt;p&gt;&lt;span style=&quot;font-family: &amp;quot;PingFang SC&amp;quot;, 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Helvetica, &amp;quot;Helvetica Neue&amp;quot;, Tahoma, Arial, sans-serif; font-size: 14px; background-color: rgb(248, 250, 252);&quot;&gt;您好。我在公司的时候面试过好多社招的PHP工程师，我认为您可以从以下几个角度准备下：1、PHP的基本知识肯定需要熟练的，面试的时候面试官会问一些细节方面的问题2、算法；数据结果；操作系统等这些是必问的，特别是在一面的时候，如果这个没过的话，基本在一面就挂了。3、找1-2个您在公司里面做的项目 好好在面试官面前讲解下，必须要突出您项目中的难点，以及你是如何解决这些难点的，在解决这些难点的过程中遇到什么问题，如何突破的等，这些如果您都可以说好的话，绝对的是在面试官面前加分的；其次 面试官会在您项目的描述中 提出一些技术的问题，您也需要做好准备，祝您面试成功；如果想来百度可以发简历我 我帮您内推。&lt;/span&gt;&lt;/p&gt;'),
