(12, 1, 0, '测试通知', '教务处', '数字化校园是以数字化信息和网络为基础，在计算机和网络技术上建立起来的对教学、科研、管理、技术服务、生活服务等校园信息的收集、处理、整合、存储、传输和应用，使教学资源得到充分优化和利用。通过实现从环境（包括设备，教室等）、资源（如图书、讲义、课件）到应用（包括教学、管理、服务、办公等）的全部数字化，在传统校园基础上构建一个数字空间，以拓展现实校园的时间和空间维度，提升传统校园的运行效率，扩展传统校园的业务功能，最终实现教育过程的全面信息化，达到提高办学质量和管理水平、从而提升核心竞争力。数字化校园是以数字化信息和网络为基础，在计算机和网络技术上建立起来的对教学、科研、管理、技术服务、生活服务等校园信息的收集、处理、整合、存储、传输和应用，使教学资源得到充分优化和利用。通过实现从环境（包括设备，教室等）、资源（如图书、讲义、课件）到应用（包括教学、管理、服务、办公等）的全部数字化，在传统校园基础上构建一个数字空间，以拓展现实校园的时间和空间维度，提升传统校园的运行效率，扩展传统校园的业务功能，最终实现教育过程的全面信息化，达到提高办学质量和管理水平、从而提升核心竞争力。', 1, 16, '2017-08-03 15:40:24', '2018-04-28 00:06:52'),
