(36, 'doc下载', 1, 3, '', '', '<p>原标题：习近平谈扶贫：必须多谋民生之利、多解民生之忧</p><p>　　党的十八大以来，习近平总书记站在全面建成小康社会、实现中华民族伟大复兴中国梦的战略高度，把脱贫攻坚摆到治国理政突出位置，提出一系列新思想新观点，作出一系列新决策新部署，推动中国减贫事业取得巨大成就，对世界减贫进程作出了重大贡献。为帮助国内外读者学习研究习近平关于扶贫的重要论述和中国脱贫攻坚的伟大实践，推动全面建成小康社会、共建人类命运共同体，中共中央党史和文献研究院会同国务院扶贫办编辑了《习近平扶贫论述摘编》。</p><p>　　本书内容，摘自习近平二〇一二年十一月十五日至二〇一八年六月期间的讲话、报告、演讲、指示、批示等六十多篇重要文献，分八个专题，共计二百四十二段论述。其中许多论述是第一次公开发表。</p><p>　　我们的人民热爱生活，期盼有更好的教育、更稳定的工作、更满意的收入、更可靠的社会保障、更高水平的医疗卫生服务、更舒适的居住条件、更优美的环境，期盼孩子们能成长得更好、工作得更好、生活得更好。人民对美好生活的向往，就是我们的奋斗目标。人世间的一切幸福都需要靠辛勤的劳动来创造。我们的责任，就是要团结带领全党全国各族人民，继续解放思想，坚持改革开放，不断解放和发展社会生产力，努力解决群众的生产生活困难，坚定不移走共同富裕的道路。</p><p>　　——《人民对美好生活的向往，就是我们的奋斗目标》（2012年11月15日），《十八大以来重要文献选编》（上），中央文献出版社2014年版，第70页</p><p>　　消除贫困、改善民生、实现共同富裕，是社会主义的本质要求。现在，我国大部分群众生活水平有了很大提高，出现了中等收入群体，也出现了高收入群体，但还存在大量低收入群众。真正要帮助的，还是低收入群众。</p><p>　　——《在河北省阜平县考察扶贫开发工作时的讲话》（2012年12月29日、30日），《做焦裕禄式的县委书记》，中央文献出版社2015年版，第15页</p><p>　　全面建成小康社会，最艰巨最繁重的任务在农村、特别是在贫困地区。没有农村的小康，特别是没有贫困地区的小康，就没有全面建成小康社会。大家要深刻理解这句话的含义。因此，要提高对做好扶贫开发工作重要性的认识，增强做好扶贫开发工作的责任感和使命感。</p><p>　　——《在河北省阜平县考察扶贫开发工作时的讲话》（2012年12月29日、30日），《做焦裕禄式的县委书记》，中央文献出版社2015年版，第16页</p><p>　　深入推进扶贫开发，帮助困难群众特别是革命老区、贫困山区困难群众早日脱贫致富，到二〇二〇年稳定实现扶贫对象不愁吃、不愁穿，保障其义务教育、基本医疗、住房，是中央确定的目标。我们要加大投入力度，把集中连片特殊困难地区作为主战场，把稳定解决扶贫对象温饱、尽快实现脱贫致富作为首要任务，坚持政府主导，坚持统筹发展，注重增强扶贫对象和贫困地区自我发展能力，注重解决制约发展的突出问题，努力推动贫困地区经济社会加快发展。</p>', '12', '2018-09-20 12:12:53', '2018-09-20 12:13:13', '2018-10-10 10:34:24', 10, '0', '迎新测试问题及优化整合---修改反馈.docx'),
