INSERT INTO `bp_new_report_set` (`id`, `report_description`, `is_start`, `end_time`) VALUES
(1, '<p><strong>一、报到时间：</strong><span lang="EN-US">2018</span>年<span lang="EN-US">9</span>月<span lang="EN-US">9</span>日</p><p><strong>二、报到地址：</strong>山东省泰安市高新区正阳门大街<span lang="EN-US">66</span>号山东财经大学东方学院</p><p><strong>三、报到所需材料清单<span lang="EN-US">:</span></strong><span lang="EN-US">&nbsp;1</span>、新生录取通知书；<span lang="EN-US">2</span>、准考证、身份证；<span lang="EN-US">3</span>、户口迁移证（注：山东省生源新生不再办理户口迁移，山东省外生源新生可自愿办理户口迁移手续）；<span lang="EN-US">4</span>、团员证及党团组织关系材料；<span lang="EN-US">5</span>、高中档案材料；<span lang="EN-US">6</span>、本人<span lang="EN-US">10</span>张照片（<span lang="EN-US">5</span>张一寸<span lang="EN-US">+5</span>张二寸，近期、同底片、彩色、正面、免冠证件照）。</p><p><strong>四、报到程序：</strong><span lang="EN-US">1</span>、各系报到；<span lang="EN-US">2</span>、校验通知书、准考证；<span lang="EN-US">3</span>、领取报到手续单；<span lang="EN-US">4</span>、交费；<span lang="EN-US">5</span>、登记学生信息；<span lang="EN-US">6</span>、住宿安排；<span lang="EN-US">7</span>、新生见面会。</p><p><strong>五、请假要求：</strong>因故不能按时报到者，请提前以书面形式向学校招生办请假（请假一般不超过两周，请写明具体请假事由和个人考生号、姓名、被录取专业等详细信息）；未请假超过两周未报到或请假逾期两周未报到者取消入学资格。<span lang="EN-US">(</span>邮寄地址：山东省泰安市高新区正阳门大街<span lang="EN-US">66</span>号山东财经大学东方学院收件人：招生办公室邮编：<span lang="EN-US">271000</span>电话：<span lang="EN-US">0538-8369888)</span></p><p><strong>六、交通及接站</strong></p><p><span lang="EN-US">1</span>、新生可凭“录取通知书”购买赴泰山火车站或泰安火车站（高铁）车票（享受学生优惠待遇）。</p><p><span lang="EN-US">2</span>、学校在泰山火车站、泰安火车站（高铁）、汽车站均设有接待站，新生可乘坐学校的接站车直接来校报到。</p><p><span lang="EN-US">3</span>、未被接到的同学，可乘坐公交车来校报到，从泰山火车站或汽车站乘坐<span lang="EN-US">K28</span>路公交车到东方学院站下车，也可乘出租车直接到校（约<span lang="EN-US">27</span>元）；从泰安火车站（高铁）下车乘坐<span lang="EN-US">56</span>路或<span lang="EN-US">44</span>路公交车到东方学院站下车，也可乘出租车直接到校（约<span lang="EN-US">25</span>元）。</p><p><span lang="EN-US">4</span>、自驾车者（建议使用导航）如走高速公路，请在京沪高速公路泰安南出口下，曲阜、高新区方向沿<span lang="EN-US">104</span>国道南行<span lang="EN-US">2000</span>米左右，入正阳门大街西行<span lang="EN-US">1000</span>米即到；未走高速公路，车行至泰安沿<span lang="EN-US">104</span>国道行至泰山医学院新校区南约<span lang="EN-US">500</span>米，入正阳门大街西行<span lang="EN-US">1000</span>米即到。</p>', 1, '2018-12-10');
