(18, '&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 30px;color: rgb(68, 68, 68);text-indent: 36px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;color: black;font-family: 微软雅黑, sans-serif;font-size: 18px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 宋体, simsun;font-size: 20px&quot;&gt;经学校研究决定，中国科技大学附中&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-family: 宋体, simsun;font-size: 20px&quot;&gt;2018&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-family: 宋体, simsun;font-size: 20px&quot;&gt;年度课题申报工作已经开始，请各教研组、学科组认真做好&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-family: 宋体, simsun;font-size: 20px&quot;&gt;2018&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-family: 宋体, simsun;font-size: 20px&quot;&gt;年度中国科技大学附中教育科研课题的申报工作，请并于&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-family: 宋体, simsun;font-size: 20px&quot;&gt;11&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-family: 宋体, simsun;font-size: 20px&quot;&gt;月&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-family: 宋体, simsun;font-size: 20px&quot;&gt;30&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-family: 宋体, simsun;font-size: 20px&quot;&gt;日之前将申报申请书填写好，并经所在教研组签署意见（一式二份）及其电子版报科大附中教科室（中学及信息组报至李茂华老师，小学及艺体组报至冯发祥老师），逾期视为自动放弃。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 30px;color: rgb(68, 68, 68);text-indent: 36px;white-space: normal;background-color: rgb(255, 255, 255);text-align: right&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 20px&quot;&gt;中科大附中&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 30px;color: rgb(68, 68, 68);text-indent: 36px;white-space: normal;background-color: rgb(255, 255, 255);text-align: right&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 20px&quo