ding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;﹕&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;00&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;，资格审查工作小组进行资格审查。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 36px;color: rgb(68, 68, 68);text-indent: 37px;white-space: normal;background: white&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;4. 9&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 19px&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;月&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;19&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;日上午&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;9&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;﹕&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;00&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;，评审推荐工作小组根据申报材料进行民主评议，确定拟推荐人选。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 36px;color: rgb(68, 68, 68);text-indent: 37px;white-space: normal;background: white&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;5.9&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 19px&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;月&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;20&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;日&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;-9&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;月&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;26&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;日：拟推荐人选名单及相关材料公示一周，期间报送大学人力资源部审批、盖章。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 36px;color: rgb(68, 68, 68);text-indent: 37px;white-space: normal;background: white&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;6.9&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 19px&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;月&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;27&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;日上午：报送相关材料至上级主管部门。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 36px;color: rgb(68, 68, 68);text-indent: 2em;white-space: normal;background: white&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;三、其它事项&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 36px;color: rgb(68, 68, 68);text-indent: 37px;white-space: normal;background: white&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;1.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 19px&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;申报各级教师职务资格所需的专业年限、任职年限、学历年限及年龄等一律按周年计算，计算截止日期为&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;2018&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;年&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;12&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;月&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;31&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;日&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 36px;color: rgb(68, 68, 68);text-indent: 37px;white-space: normal;background: white&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;．由于附中近年来高级教师未聘人员较多，学校将根据大学上一批聘用高级教师人数，等额确定附中申报高级职称人数。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 36px;color: rgb(68, 68, 68);text-indent: 37px;white-space: normal;background: white&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;3.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;一级、高级教师职务的笔试、面试具体时间另行通知。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 36px;color: rgb(68, 68, 68);text-indent: 37px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;4.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 19px&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;纪律要求：对伪造学历、资历、剽窃和侵吞他人成果，抄袭他人论文等弄虚作假的申报人，一经查实，&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;5&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;年内取消申报资格，并视情节追究有关人员的责任；评审已通过的，撤销其专业技术资格，收回专业技术资格证书。对包庇、纵容弄虚作假行为的个人，按有关规定给予严肃处理&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 36px;color: rgb(68, 68, 68);text-indent: 37px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;5.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;其他类别的职称评审工作安排等上级教育主管部门的通知下达后再另行通知。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 36px;color: rgb(68, 68, 68);text-indent: 37px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;6.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;其他相关要求，按照上级相关文件执行。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 36px;color: rgb(68, 68, 68);text-indent: 37px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;7.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;相关文件及表格见附件。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 36px;color: rgb(68, 68, 68);text-indent: 37px;white-space: normal;background: white&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;特此通知。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 36px;color: rgb(68, 68, 68);text-indent: 37px;white-space: normal;background: white&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 36px;color: rgb(68, 68, 68);text-indent: 401px;white-space: normal;background: white;text-align: right&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;科大附中&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 36px;color: rgb(68, 68, 68);text-indent: 364px;white-space: normal;background: white;text-align: right&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;2018&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 19px&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;年&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;9&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;月&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;12&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(0, 0, 0);font-family: 宋体, simsun;font-size: 18px&quot;&gt;日&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '');
INSERT INTO `bp_noticedetail` (`nc_id`, `nc_content`, `nc_attach`) VALUES
(21, '&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 37px;color: rgb(68, 68, 68);text-indent: 2em;white-space: normal;background-color: rgb(255, 255, 255);text-align: center&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;包教〔&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-family: &amp;#39;times new roman&amp;#39;;font-size: 18px&quot;&gt;2018&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;〕&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-family: &amp;#39;times new roman&amp;#39;;font-size: 18px&quot;&gt;61&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;号&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 35px;color: rgb(68, 68, 68);text-indent: 2em;white-space: normal;background-color: rgb(255, 255, 255);text-align: center&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 35px;color: rgb(68, 68, 68);text-indent: 2em;white-space: normal;background-color: rgb(255, 255, 255);text-align: center&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 44px;color: rgb(68, 68, 68);text-indent: 2em;white-space: normal;background-color: rgb(255, 255, 255);text-align: center&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 方正小标宋简体;font-size: 29px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;关于开展包河区&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;2018&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;年教育系统先进集体和先进个人评选工作的通知&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 18px;font-family: 宋体;line-height: 31px;color: rgb(68, 68, 68);text-indent: 2em;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 2em;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;区属中小学、幼儿园，局二级机构及驻区有关单位：&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;为庆祝第&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;34&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;个教师节，大力宣传广大优秀教师和教育工作者爱岗敬业、为人师表、无私奉献的先进事迹，弘扬人民教师的高尚师德，进一步激励全区广大教师争做“四有”好老师，在全社会进一步营造尊师重教的良好风尚，努力建设一支品德高尚、敬业爱生、业务精湛的专业化教师队伍，经研究决定，在全区范围内开展师德建设先进集体、师德先进个人、优秀教师、优秀教育工作者、优秀班主任、优秀支教教师和教学新秀评选工作。现将有关事项通知如下：&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 黑体;font-size: 18px&quot;&gt;一、评选范围&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 楷体;font-size: 18px&quot;&gt;1.&lt;/span&gt;&lt;/strong&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 楷体;font-size: 18px&quot;&gt;师德建设先进集体评选范围。&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;全区中小学校、幼儿园及驻区有关单位。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 楷体;font-size: 18px&quot;&gt;2.&lt;/span&gt;&lt;/strong&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 楷体;font-size: 18px&quot;&gt;优秀教师（含师德楷模、师德先进个人）、优秀教育工作者和优秀班主任评选范围。&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;在全区教育系统中从事教育教学、教育教学管理和服务工作并取得显著成绩的教师、教育工作者和班主任。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 楷体;font-size: 18px&quot;&gt;3.&lt;/span&gt;&lt;/strong&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 楷体;font-size: 18px&quot;&gt;优秀支教教师评选范围。&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;六安结对帮扶教师、薄弱学校或薄弱学科专项驻点支教的教师、组织安排到薄弱学校支教的教师、区艺体教师服务中心等取得优异成绩的各类支教教师。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 楷体;font-size: 18px&quot;&gt;4.&lt;/span&gt;&lt;/strong&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 楷体;font-size: 18px&quot;&gt;教学新秀评选范围。&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;近&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;5&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;年参加工作，在教育教学中取得突出成绩的年轻教师。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 黑体;font-size: 18px&quot;&gt;二、表彰名额&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(13, 13, 13);font-family: 楷体;font-size: 18px&quot;&gt;1.&lt;/span&gt;&lt;/strong&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;letter-spacing: -1px;font-family: 楷体;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;师德建设&lt;/span&gt;&lt;span style=&quot;;padding: 0px;color: rgb(13, 13, 13)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;先进集体&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;16&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;个。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;学校自主申报，经研究择优推荐&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;4&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;个师德建设先进集体上报市表彰，评选&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;12&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;个单位进行区级表彰。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(13, 13, 13);font-family: 楷体;font-size: 18px&quot;&gt;2.&lt;/span&gt;&lt;/strong&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(13, 13, 13);font-family: 楷体;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;优秀教师&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;118&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;名（含师德先进个人&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;18&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;名）&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;;padding: 0px;color: rgb(13, 13, 13);letter-spacing: -1px;font-family: 楷体;font-size: 18px&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;由各学校按分配名额等额上报，择优推荐&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;18&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;个师德先进个人（&lt;/span&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;含&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;名师德楷模候选对象&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;）上报到市表彰，评选&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;100&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;名优秀教师进行区级表彰。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(13, 13, 13);font-family: 楷体;font-size: 18px&quot;&gt;3.&lt;/span&gt;&lt;/strong&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(13, 13, 13);font-family: 楷体;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;优秀教育工作者&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;60&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;名&lt;/span&gt;&lt;span style=&quot;;padding: 0px;letter-spacing: -1px;font-size: 18px&quot;&gt;。&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;由各学校按分配名额等额上报，经研究后进行区级表彰。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(13, 13, 13);font-family: 楷体;font-size: 18px&quot;&gt;4.&lt;/span&gt;&lt;/strong&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(13, 13, 13);font-family: 楷体;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;优秀班主任&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;120&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;名。&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;由各学校按分配名额等额上报，经研究后进行区级表彰。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(13, 13, 13);font-family: 楷体;font-size: 18px&quot;&gt;5.&lt;/span&gt;&lt;/strong&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(13, 13, 13);font-family: 楷体;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;优秀支教教师&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;20&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;名。&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;由区教体局组织人事科、区教体局教研室、艺体教师服务中心提名，经研究后进行区级表彰。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(13, 13, 13);font-family: 楷体;font-size: 18px&quot;&gt;6.&lt;/span&gt;&lt;/strong&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 楷体;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;教学新秀&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;80&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;名。&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;由学校提名，区教研室审核，经研究后进行区级表彰。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 黑体;font-size: 18px&quot;&gt;三、评选条件&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 楷体;font-size: 18px&quot;&gt;（一）教育系统先进集体评选条件&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;1.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;认真贯彻落实党的教育方针，坚持社会主义办学方向。严格执行国家的法律法规，大力加强社会主义精神文明建设，深入贯彻《中共中央国务院关于全面深化新时代教师队伍建设改革的意见》《教育部关于建立健全中小学师德建设长效机制的意见》，严格落实《合肥市严禁中小学校和在职中小学教师有偿补课实施办法》《合肥市中小学教师违反师德行为处理办法》，无重大安全责任事故和违规办学、违反教师职业道德现象。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;2.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;高度重视师德建设工作，师德建设机制健全。有完善的师德教育、考评制度和监督机制，师德建设制度化、规范化、常态化，注重维护师生合法权益。严格实行师德年度考核和师德建设“一票否决制”，并结合实际，经常开展各种形式的师德教育活动，校本培训和岗前培训中突出师德教育内容，取得显著的成果。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;3.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;学校领导班子团结和谐，战斗力强，工作勤奋扎实，勇于开拓创新，廉洁奉公，发扬民主，干群关系好，群众威信高，在师德建设方面言传身教、率先垂范，在学校管理、教育教学、维护教职工权益等方面工作成绩突出，学校受到县级及以上表彰。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;4.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;教职工严格执行师德师风的相关要求，普遍具有良好的职业道德，爱岗敬业，严谨治学，热爱学生，为人师表，终身学习，具有较强的职业荣誉感和自豪感。受到学生、家长和社会的广泛好评，师德水平和教育效果在本地区或系统内处于领先水平，涌现了一定数量的师德优秀群体。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;5.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;注重发挥师德先进的引领作用，树立一批师德先进教师典型。大力宣传师德先进典型的模范事迹，形成鼓励全体教师学习先进事迹、争做师德表率的良好风尚。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;6.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;近三年来，有下列情形之一者，不得参评。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;（&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;）单位教职工违法违纪等受到党纪政纪处分或追究刑事责任的；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;（&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;）单位发生安全稳定方面的事故，或教职工违背职业道德规范受到通报批评的；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;（&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;）单位管理失误等造成不良社会影响的。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 楷体;font-size: 18px&quot;&gt;（二）优秀教师评选条件&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 楷体;font-size: 18px&quot;&gt;1.&lt;/span&gt;&lt;/strong&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 楷体;font-size: 18px&quot;&gt;区级优秀教师评选条件&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;（&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;）全面贯彻党的教育方针，忠诚党的教育事业，政治立场坚定，具有强烈的事业心、责任感和敬业精神，模范履行教师职责，得到学校、社会、学生及家长的一致好评。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;（&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;）治学严谨，为人师表，师德高尚，切实践行《中小学教师职业道德规范》，关注学生发展，注重教书育人，注重品德教育，积极参与学生管理。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;（&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;）出色完成教育教学工作任务，致力教学创新，在教育教学改革、提高教育教学质量等方面取得显著成绩。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;（&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;4&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;）在教育教学研究、教育教学成果推广等方面取得显著成绩。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;2.&lt;/span&gt;&lt;/strong&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;市级师德先进个人评选条件&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;（&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;）立场坚定。认真贯彻执行党的基本路线和方针政策，遵守国家法律法规；认真贯彻执行党的教育方针，忠诚教育事业，践行社会主义核心价值观，争做新时代好老师。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;（&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;）爱岗敬业。具有强烈的主人翁责任感和事业心，锐意改革，勇于创新，刻苦钻研业务，认真完成教育教学任务，积极推进素质教育，不断提高教书育人水平，在本职岗位上做出显著成绩，受到广大师生好评。同等条件下，有班主任工作经历者优先。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;（&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;）师德高尚。热爱学生，为人师表&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;,&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;遵守教师职业道德规范，能充分展现人民教师和教育工作者良好形象&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;;&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;团结同事，行为举止文明礼貌，遵守社会公德、家庭美德；能够以身作则，廉洁从教，自觉抵制各种不正之风。近三年内年度考核和师德考核均为合格等次及以上，且至少有一年为优秀等次。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;3.&lt;/span&gt;&lt;/strong&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;市级师德楷模评选条件&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;师德楷模除具有上述师德先进个人的条件外，还应具备如下条件：&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;（&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;）师德典范。在爱护学生、开展学生思想政治教育和未成年人思想道德建设、转化行为偏差学生、帮助困难学生、对口支援等方面表现突出。有典型的感人事迹，在单位或本区域内有一定知名度，社会反映良好。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;（&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;）业务精湛。全面贯彻党的教育方针，坚持素质教育，勤于钻研，高质量地完成教育教学任务，努力进行教育教学创新，在教育教学改革、课程建设、提高教学质量等方面成绩突出。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;（&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;）深受学生爱戴和社会赞誉。热爱教育工作，具有丰富的教育教学工作经验，注重学生思想道德品质的培养，工作有针对性、实效性、科学性，有突出成绩。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 楷体;font-size: 18px&quot;&gt;（三）优秀教育工作者评选条件&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;．全面贯彻党的教育方针，忠诚党的教育事业，政治立场坚定，具有强烈的事业心、责任感和敬业精神，模范履行管理工作职责，得到教职工、学生及家长的一致好评。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;．出色完成上级教育部门部署的工作任务，认真贯彻落实好学校的重大决策决定，全局意识强。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;．自觉加强学习，刻苦钻研业务；坚持原则、作风正派、廉洁奉公、求真务实，勇挑重担、尽职尽责，在教育教学管理和服务等方面取得显著成绩。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;4&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;．组织协调能力强，能团结协作。不计较个人得失，奉献精神强。开拓创新，为学校及师生发展做出积极贡献。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 楷体;font-size: 18px&quot;&gt;（四）&lt;/span&gt;&lt;/strong&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 楷体;font-size: 18px&quot;&gt;优秀班主任&lt;/span&gt;&lt;/strong&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 楷体;font-size: 18px&quot;&gt;评选条件&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;．坚持立德树人。全面贯彻党的教育方针，忠诚党的教育事业，政治立场坚定，具有强烈的事业心、责任感和敬业精神。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;．工作成效明显。认真履行班主任工作职责，加强班级文化建设。所任班级班风、学风优良&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;,&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;学生在两年内无违反犯罪或受到学校处分的现象。与家庭、社区的沟通协调，积极开展家访，在家教会、家长学校建设等方面取得显著成效。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;．注重自身素质提升。积极参与班主任工作培训、基本功大赛等，在学校班级主题队会评比中成绩优秀，学习心理健康教育知识，利用多种途径开展心理健康教育。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;4&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;．连续三年及以上担任班主任，且在&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;2017-2018&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;学年度内担任班主任。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;color: rgb(13, 13, 13);font-family: 楷体;font-size: 18px&quot;&gt;（五）优秀支教教师&lt;/span&gt;&lt;/strong&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 楷体;font-size: 18px&quot;&gt;评选条件&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;1.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;忠诚于党的教育事业，师德高尚，积极要求从事支教工作，服从各级教育行政部门和受援单位的领导，服从组织分配；不畏艰苦、乐于奉献、勇挑重担，出色完成派出单位和受援单位交给的各项任务。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;2.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;热爱受援学校，关心学生全面成长，教书育人，为人师表，团结同志，深受受援学校师生的欢迎，能够在支教工作中发挥模范带头作用。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;3.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;充分发挥引领和示范作用，主动帮助受援学校培训教师，共同提高教育教学水平。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 楷体;font-size: 18px&quot;&gt;（六）教学新秀评选条件&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;．教龄&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;至&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;5&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;年（&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;2013&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;年&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;7&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;月以来参加工作的教师）；&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;2017&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;年已被评为教学新秀的不再推荐参加评选。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;．热爱教育工作，讲师德，爱学生；教学认真，治学态度严谨，勤于钻研；具有先进的教育理念，并能够在教学实践中加以体现；课堂教学改革中有创新，有成效。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;．近&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;5&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;年在教育主管部门组织的课堂教学评比中获得市级以上奖励。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;各单位所推荐的优秀教师、优秀教育工作者、优秀班主任、优秀支教教师、教学新秀评选对象，近&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;年有下列情形之一者，实行“一票否决”：&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;．因违背职业道德规范等受到党纪政纪处分或追究刑事责任的；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;．在教育教学工作中表现不佳受到有关教育部门或所在学校通报的；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;．校内或校外参与有偿补课的；收受学生礼品、礼金等违背职业道德规定的；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;4.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;违反学校相关管理制度，情节比较严重的。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 黑体;font-size: 18px&quot;&gt;四、评选方法和要求&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;评选推荐工作采取个人申报与组织推荐相结合，学校成立评审领导小组，认真组织开展评选推荐工作。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;1.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;评选推荐工作要坚持公开、公正、公平。在评选推荐过程中，要组织教职工广泛参与，民主评选，公正推荐。推荐人选须在本单位进行公示，公示期不少于&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;5&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;天。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;2.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;评选推荐工作要坚持实事求是，注重师德表现和工作实绩，并向一线教师倾斜。兼任学校中层及以上管理职务的教师参加优秀教师评选的，每周兼课应当不少于本学科专任教师课时量的&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;50%&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 黑体;font-size: 18px&quot;&gt;五、材料上报要求&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 31px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;为保证评选推荐工作顺利开展，各单位务必于&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;2018&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;年&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;8&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;月&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;7&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;日下午下班前报送下列材料纸质版：&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 31px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;1.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;《包河区&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;2017-2018&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;学年度表彰先进个人审批表》（附件&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;）、《包河区&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;2017-2018&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;学年度表彰先进个人推荐人选一览表》（附件&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;）《包河区教育系统师德建设先进集体审批表》（附件&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;4&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;）《包河区教育系统先进集体推荐对象汇总表》（附件&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;4&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;）各一式二份（加盖公章），报送至区教体局组织人事科。同时报送电子版（附件&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;、&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;、&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;4&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;、&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;5&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;）至&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;bhqjyjrsk@126.com&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;。联系人：陈庆，联系电话：&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;63357133&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 31px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;2.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;申报师德建设先进集体，须准备&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;2000&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;字左右师德建设经验材料；申报师德楷模，须准备&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;2000&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;字左右事迹材料。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 31px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;3.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;驻区企事业、民办幼儿园参评人员材料由区教体局学前教育科按照分配名额择优推荐到组织人事科。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 31px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;4.&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;各单位评选推荐工作要形成以书面小结，与上述材料报送区教体局组织人事科。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 31px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255);text-align: right&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;合肥市包河区教育体育&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 33px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255);text-align: right&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: 仿宋_gb2312;font-size: 18px&quot;&gt;2018&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 21px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;年&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;7&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;月&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;31&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;日&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;;padding: 0px;font-size: 14px;font-family: 宋体;line-height: 31px;color: rgb(68, 68, 68);text-indent: 43px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-size: 18px&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', ''),
(23, '&lt;p style=&quot;text-align: center;&quot;&gt;周末放假通知1.1-1.3&lt;/p&gt;', ''),
(24, '&lt;p style=&quot;text-align: center;&quot;&gt;2018元旦放假通知&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 随着时间的到来人们对元旦的重视程度越来越高，本公司将尊重国家统治放假3天与1.1-1.3放假&lt;/p&gt;', '');
