INSERT INTO `bp_sysmoduledetail` (`sd_id`, `sd_content`, `sd_url`, `sd_attach`) VALUES
(2, '&lt;p&gt;这是OA系统。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 'http://127.0.0.1:8004/account/judge', 'http://www.baidu.com'),
(3, '&lt;p&gt;迎新系统入口&lt;/p&gt;', 'http://127.0.0.1:8004/account/judge', ''),
(4, '&lt;p&gt;学校每年都投入大量的金钱来购置各种资产，但是随着时间的推移，很难及时、清楚地知道学校拥有多少资产，它们分布在那些部门以及存放在何处、谁在使用、状况如何；并且固定资产的利用效率低，重复购置现象严重；经常存在无法快速完整的查清某个人手中保管的资产，从而造成资产的流失；核查和盘点工作量大，出错率较高，给资产管理部门带来了很多工作难题和错误。经常存在帐物不符、帐面价值与实际价值有很大出入等现象。&lt;/p&gt;&lt;p&gt;针对以上问题，传统的手工管理方式和一般的固定资产管理软件都无法解决以上所有的问题。我公司在充分研究分析学校对固定资产管理业务需求的基础上，有针对性的开发出了以实物管理为特点，以计算机为操作平台，以“快捷”、“精准”和功能全面为优势的B/S架构智慧固定资产管理系统。&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://47.96.171.165:8004/public/plugins/ueditor/themes/default/images/spacer.gif&quot;/&gt;&lt;/p&gt;', 'http://127.0.0.1:8004/account/judge', ''),
(5, '&lt;p&gt;教职工系统入口&lt;/p&gt;', 'http://127.0.0.1:8004/account/judge', ''),
(6, '&lt;p&gt;学生费用管理系统入口&lt;/p&gt;', 'http://127.0.0.1:8012', ''),
(7, '&lt;p&gt;智慧排课入口&lt;/p&gt;', 'http://127.0.0.1:8004/account/judge', ''),
(8, '&lt;p&gt;学生管理系统入口&lt;/p&gt;', 'http://127.0.0.1:8004/account/judge', ''),
(9, '&lt;p&gt;1212&lt;/p&gt;', '12', '');
